Derrick's having a bad day. He's late to work and his car won't start, so he hopes his friend's hot mom Kristal Summers can give him a jump. But when she can't find jumper cables, he doesn't really care because he's hoping she will jump his bones instead. Maybe this won't be a bad day after all!
